import React from "react";

import classes from "./Nav.module.css";

const Nav = (props) => {
  const navClass = props.isMobile
    ? `${classes.nav} ${classes.mobile}`
    : classes.nav;

  return (
    <nav className={navClass}>
      <ul className={classes["nav__list"]}>
        <li
          className={`${classes["nav__item"]} ${classes["nav__item--current"]}`}
        >
          <a href="#home">Home</a>
        </li>
        <li className={classes["nav__item"]}>
          <a href="#about">About</a>
        </li>
        <li className={classes["nav__item"]}>
          <a href="#projects">Projects</a>
        </li>
        <li className={classes["nav__item"]}>
          <a href="#contact">Contact</a>
        </li>
      </ul>
      {props.isMobile && (
        <>
          <span>Mahdi Zangeneh</span>
          <div class="hamburger-menu" onClick={props.onClick}>
            <span></span>
            <span></span>
            <span></span>
            <span></span>
          </div>
        </>
      )}
    </nav>
  );
};

export default Nav;
